window.bookSummaryJSON = "<p>In this gripping doomsday thriller ripped from the headlines... </p> <p>Iran has threatened to destroy Israel while developing the nuclear capability to do so. Struck by a medical emergency, Israel's Prime Minister falls unconscious just as military action is needed to stop Iran's nukes. History is now up to 35 Israelis aboard the Dolphin a powerful submarine armed with nuclear-tipped ballistic missiles. </p> <p>Ship unity is crucial to mission success, but deep conflicts rise to the surface among crew members who are ethnically diverse and ideologically divided. On their suspenseful voyage to Armageddon, the submariners must confront pulse-pounding threats at sea before facing an unthinkable dilemma. It will be the toughest decision of their lives - and it will determine the fate of the Middle East.</p>"; 
